import React from "react";
import SubTitle from "../atoms/SubTitle";

export default class MeetupNow extends React.Component {
	constructor(){
		super()
		this.state = {
			subtitle: `About Meetup`,
			Message: `Come and meet other developers in teh JavaScript and it's library in the Greater Jakarta area`,
			twiter: `@JakartaJs and we use the hashtag #jakartajs`
		};
	}
	render() {
		return (
			<div>
				<SubTitle subtitle = {this.state.subtitle} />
				<div className="mx-10">
					<p>Come and meet other developers in teh JavaScript and it's library in the Greater Jakarta area</p>
					<br/>
					<p>Twitter: @JakartaJs and we use the hashtag #jakartajs</p>
				</div>
			</div>
		)
	}
	
}
